  val emptyString = ""
  val space = ' '

  @tailrec
    def checker(word: String, wanted: String, leftToCheck: String, flag: Boolean): Boolean = //sprawdza czy string wanted zawiera si w string word
      word match
        case _ if leftToCheck == emptyString => true
        case _ if (word == emptyString || word.head != space) && leftToCheck.head == space => checker(word.tail, wanted, leftToCheck.tail, false)
        case "" => false
        case _ if word.head == leftToCheck.head => checker(word.tail, wanted, leftToCheck.tail, false)
        case _ if flag => checker(word.tail, wanted, wanted, false)
        case _ => checker(word, wanted, wanted, true)


  def removeSpace(list: List[String]): List[String] = //usuwa spacje na pocztku sw
    @tailrec
    def removeSpaceHelper(list: List[String], string: String, acc: List[String]): List[String] =
      if string != emptyString && string.head == space then removeSpaceHelper(list, string.tail, acc)
      else
        list match
          case _ :: listSecHead :: _ => removeSpaceHelper(list.tail, listSecHead, string :: acc)
          case listHead :: _ => removeSpaceHelper(list.tail, listHead, string :: acc)
          case Nil => acc
    if !list.isEmpty then removeSpaceHelper(list, list.head, Nil)
    else list


  def findN(xs: List[String], wantedList: List[String]): String =
      def findHelper(xs: List[String], wanted: String, acc: List[String]): List[String] =
        if wanted == emptyString then Nil
        else
          xs match
            case xh :: xt => if checker(xh, wanted, wanted, false) then findHelper(xt, wanted, xh :: acc) else findHelper(xt, wanted, acc)
            case Nil => acc

      val wanted = removeSpace(wantedList)
      val result =  wanted.map(want => findHelper(xs, want, Nil))
      result.toString()


  def findNParallel(xs: List[String], wantedList: List[String]): List[String] =
    def findHelper(xs: List[String], wanted: String, acc: List[String]): List[String] =
      if wanted == emptyString then Nil
      else
        xs match
          case xh :: xt => if checker(xh, wanted, wanted, false) then findHelper(xt, wanted, xh :: acc) else findHelper(xt, wanted, acc)
          case Nil => acc

    val wanted = removeSpace(wantedList)
    val futures = wanted.map(want => Future{findHelper(xs, want, Nil).toString()})
    futures.map(Await.result(_, Duration.Inf))


  val fib3 = (n:Int)=>
  {
    def fib3Helper(n:Int):Int=
    {
      if  n< 2 then n
      else
        if n == 2 then 1
        else
          fib3Helper(n-3) + fib3Helper(n-2) + fib3Helper(n-1)
    }
    fib3Helper(n)
  }


  val fib3Parallel = (n:Int)=>
  {
    def fib3Helper(n:Int):Int=
    {
      if  n< 2 then n
      else
        if n == 2 then 1
        else
          fib3Helper(n-3) + fib3Helper(n-2) + fib3Helper(n-1)
    }
    if  n< 2 then n
    else
      if n == 2 then 1
      else
        val futures = List(Future{fib3Helper(n-3)}, Future{fib3Helper(n-2)}, Future{fib3Helper(n-1)})
        futures.foldLeft(0)((A, B) => A + Await.result(B, Duration.Inf))
  }


